// *** 普通实现 ***
func strStr(haystack string, needle string) int {
	var idx int
	if needle == "" {
		return 0
	}
	for idx = 0; idx < len(haystack)-len(needle)+1; {
		var matchCount = 0
		for ni := 0; ni < len(needle); ni++ {
			if needle[:ni+1] == haystack[idx:idx+ni+1] {
				matchCount++
			} else {
				idx++
				break
			}
			// matched !
			if matchCount == len(needle) {
				return idx
			}
		}
	}
	return -1
}

// *** KMP ***
type kmp struct {
	pat []rune
	len int
	pm  map[rune][]int
}

func NewKMP(needle string) (k *kmp) {
	k = &kmp{}
	k.pat = []rune(needle)
	k.len = len(k.pat)

	k.pm = make(map[rune][]int)

	for i := 0; i < k.len; i++ {
		if _, ok := k.pm[k.pat[i]]; !ok {
			k.pm[k.pat[i]] = make([]int, 1)
			k.pm[k.pat[i]][0] = i
		} else {
			k.pm[k.pat[i]] = append(k.pm[k.pat[i]], i)
		}
	}
	return k
}

func (k *kmp) Search(haystack string) int {
	if k.len == 0 {
		return 0
	}
	haystacks := []rune(haystack)

	for idx := 0; idx < len(haystacks)-k.len+1; {
		var ni = 0
	MATCH:
		for ; ni < k.len; ni++ {
			if idx+ni >= len(haystacks) {
				return -1
			}
			if k.pat[ni] != haystacks[idx+ni] {
				if ni > 0 {
					last := k.pm[k.pat[ni-1]]
					ni -= 1
					if len(last) > 1 {
						for s := len(last) - 1; s >= 0; s-- {
							if last[s] == ni && s > 0 {
								ni = s - 1
								if ni == 0 {
									fmt.Println("A")
									idx += ni + 1
									break MATCH
								} else {
									idx++
									goto MATCH
								}
							}
						}
						idx++
					} else {
						idx += ni + 1
					}
				} else {
					idx += ni + 1
				}

				break
			}
			// matched !
			if ni == k.len-1 {
				return idx
			}
		}
	}
	return -1
}

// kmp
func strStrKmp(haystack string, needle string) int {

	k := NewKMP(needle)

	return k.Search(haystack)
}
